public class Main {
  public static void main(String[] args) {
    for (int Row=1;Row<=10;Row++)
    {
      for (int Column=1;Column<=10;Column++)
      {
       System.out.print(Row*Column+"\t");
      } 
      System.out.println();
    }
  }
}

